INSERT INTO `csinla_posts_post` VALUES (4,'2015 奔驰G63 好车出售！！','二手车','2017-04-02 18:11:00.000000','2017-05-31 00:00:00.000000',0,'G63！！ 全部雅黑配色，全新的轮胎，红黑配色，音响蓝牙，导航倒影，所有设备一应俱全。LA现车，只跑了不到1w miles. 欢迎随时来试车~','3107753739','Owenlala1127',8,'2017-04-04 17:02:00.000000',0,1),(5,'2014 C-Class C63 AMG Coupe','二手车','2017-04-02 18:11:00.000000','2017-05-31 00:00:00.000000',0,'C63 一只白色野兽，倒车雷达，倒车影像，车载导航，座椅加热，超大天窗等各种配置齐全~~\r\n\r\n车就在LA，欢迎来店试车！！！','3107753739','Owenlala1127',8,'2017-04-04 17:03:00.000000',0,1),(8,'2014 G63 AMG','二手车','2017-04-02 18:11:00.000000','2017-05-31 00:00:00.000000',0,'2014年的G63 AMG，黑红的内饰，只跑了1.6w miles. 倒车影像，内置导航，顶级音响一应俱全！LA现车，随时欢迎来看车~','3107753739','Owenlala1127',8,'2017-04-04 17:02:00.000000',0,1),(10,'2016 C300 4MATIC 四驱好车','二手车','2017-04-02 18:11:00.000000','2017-05-31 00:00:00.000000',0,'白色四驱C300，黑色内饰，只跑了1w miles, 价格3字头。倒车影像，内置导航等配置全部都有~ 2016年的准新车，欢迎随时来看车~~','3107753739','Owenlala1127',8,'2017-04-04 17:02:00.000000',0,1),(11,'2015 奔驰 C-Class C300','二手车','2017-04-02 18:11:00.000000','2017-05-31 00:00:00.000000',0,'白色C300，倒车影像，车内导航，后驱动力，省油有面儿~劲爆的音响更让你爱上这辆白色的小野兽~~LA现车，随时欢迎试驾~','3107753739','Owenlala1127',8,'2017-04-04 17:02:00.000000',0,1),(13,'2016 AMG GT S','二手车','2017-04-03 03:11:00.000000','2017-05-31 00:00:00.000000',0,'16年 奔驰 AMG GT S，只跑了1w英里，劲爆的价格，劲爆的动力，劲爆的驾驶体验。配置不用说，一脚一门，一个黑夜的传说~~LA现车，随时欢迎来试驾！','3107753739','Owenlala1127',8,'2017-04-04 17:02:00.000000',0,1),(14,'2016 奔驰 C63 我的黑煞 AMG-S','二手车','2017-04-03 03:10:00.000000','2017-05-31 00:00:00.000000',0,'黑煞：只跑了1w英里的C63，2016年的准新车。全黑的外观和配饰，后驱稳定的加速配上前驱方向控制。6.3L的超大排量，8缸的动力，让你在启动的时候就会为之赞叹。','3107753739','Owenlala1127',8,'2017-04-04 17:02:00.000000',0,1),(15,'HJ第二只 2016 C63 黑色黑煞','二手车','2017-04-03 03:10:00.000000','2017-05-31 00:00:00.000000',0,'2016 黑色C63，倒影，导航，天窗，神秘，速度，妹子…… LA现车，欢迎随时来看车','3107753739','Owenlala1127',8,'2017-04-04 17:02:00.000000',0,1),(16,'2015 c300 4Matic 好车出售','二手车','2017-04-03 03:11:00.000000','2017-05-31 00:00:00.000000',0,'新车到店，一个白色的C300，只跑了1.7w英里。四门，导航，倒影，白色外饰，白色内饰。一脚油门踩下去，速度搜搜的~~','3107753739','Owenlala1127',8,'2017-04-04 17:02:00.000000',0,1),(17,'2015 奥迪 A7 3.0T','二手车','2017-04-03 03:10:00.000000','2017-05-31 00:00:00.000000',0,'最帅的最帅的轿跑，既有容量又有速度，一天换一天女乘客~~15年的A7只跑了2.4w英里，各种内置齐全，价格价格更是只要4.6w！！ 简直完美~~','3107753739','Owenlala1127',8,'2017-04-04 17:02:00.000000',0,1),(18,'奥迪A7超级轿跑，14年','二手车','2017-04-03 03:11:00.000000','2017-05-31 00:00:00.000000',0,'A7A7A7A7，实在是太帅。全黑外饰+内饰。一脚油门下去，十万八千里。要空间有空间，要速度有速度。14年的车既没问题，价格还美丽。还在等什么？车在LA，欢迎随时来试车！','3107753739','Owenlala1127',8,'2017-04-04 17:02:00.000000',0,1),(25,'【暑假短租】4月底到7.31','个人转租','2017-04-04 17:02:39.792487','2017-04-30 00:00:00.000000',0,'【暑期短租】4月底到7.31  \r\n学校旁边house \r\n单间出租 住的全是usc学生 \r\n0.5个bathroom  家具齐全 拎包入住\r\n很多柜子 有closet 中央空调 full size床 采光特别好 \r\n走到学校10min 因为到时候我要搬家 所以房间会是空的 水电煤气全包  \r\n院里可以免费停车\r\n价格可以商量 微信wrfmatilda \r\n欢迎私聊','000','wrfmatilda',8,'2017-04-04 17:02:39.792614',0,1),(29,'红色奔驰cla250 出售','二手车','2017-04-04 17:02:00.000000','2017-06-30 00:00:00.000000',0,'红色cla250现在出售！蓝牙，音响，倒影，导航，轮胎检测全部都有~ 速度，好看，女孩子首选~\r\n\r\n车在LA，随时欢迎来看车','3107753739','Owenlala1127',8,'2017-04-04 17:02:00.000000',0,1),(30,'13年的奔驰GLK350，好车还便宜！！','二手车','2017-04-04 17:02:00.000000','2017-06-30 00:00:00.000000',0,'春季大降价，2013款本次GLK350！白色配黑色内饰，跑了3w，出门2字头~\r\n\r\n车在LA，欢迎试驾及咨询~','3107753739','Owenlala1127',8,'2017-04-06 03:14:00.000000',0,1),(31,'2013 银灰色两门保时捷boxster','二手车','2017-04-04 17:02:00.000000','2017-06-30 00:00:00.000000',0,'新车到店，两门的保时捷银灰boxster；保时捷的经典跑车之一。无论是外观还是内在都是完美无缺，更完美的是它的颜色，银灰，华丽而不张扬~\r\n\r\n车在LA，随时欢迎来试车~','3107753739','Owenlala1127',8,'2017-04-04 17:02:00.000000',0,1),(32,'2014 保时捷 Boxster S','二手车','2017-04-05 03:00:00.000000','2017-06-30 00:00:00.000000',0,'宝蓝色boxster S！！比 boxster 还快的 boxster~各种配置一应俱全，蓝牙，导航，倒影，敞篷拉风，红色内饰~配上这小速度，简直完美~\r\n\r\n车子就在LA，欢迎来试车以及咨询','3107753739','Owenlala1127',8,'2017-04-05 03:00:00.000000',0,1),(33,'2016年的银灰色卡宴','二手车','2017-04-05 03:08:00.000000','2017-06-30 00:00:00.000000',0,'银色卡宴base, 2016年的跑了2w英里，只要5字头出么。\r\nV6发动机，全是四驱动力系统，SUV里面他最美，最美的车里面他最SUV~\r\n\r\n车在LA，欢迎来看车咨询','31